 const Shop =()=> {
    const myObject = [
        {
            title:'All',
            path:'/all',
            cName: 'dropdown-link'
        },
        {
            title:'DVDS',
            path:'/dvds',
            cName: 'dropdown-link'
        },
        {
            title:'DVD Bundels',
            path:'/dvdbundels',
            cName: 'dropdown-link'
        },
        {
            title:'Video On Demand',
            path:'/videoondemand',
            cName: 'dropdown-link'
        },
        {
            title:'Video On Demand Bundles',
            path:'/videoondemandbundles',
            cName: 'dropdown-link'
        },
        {
            title:'Books',
            path:'/books',
            cName: 'dropdown-link'
        },
        {
            title:'Posters',
            path:'/posters',
            cName: 'dropdown-link'
        },
        {
            title:'Gear',
            path:'/gear',
            cName: 'dropdown-link'
        },
        {
            title:' Gift Cards',
            path:'/giftcard',
            cName: 'dropdown-link'
        },
        {
            title:'Courses',
            path:'/courses',
            cName: 'dropdown-link'
        }
    ]

    return (
        <div>
          {myObjects.map((obj, index) => (
            <div key={index}>
              <p>Title: {obj.title}</p>
              <p>Path: {obj.path}</p>
              <p>ClassName: {obj.cName}</p>
            </div>
          ))}
        </div>
      );

}
export default Shop;
